%[text] # 1 ICESat-2 ATL03 Data Access
%[text] ## 1.1 Get coastal polygons
% define parameters
reso = 'c';
bbox = [-180 180; -60 66];
bufwidth = {3 .25}; % {outer inner} degrees
tol = 0.1; % degrees
min_area = 100; % km2

% specify query points manually to remove land polygons
% latq = [];
% lonq = [];
latq = [65.95 65.95 65.95 65.98];
lonq = [-174 -162 44 72];

% clip into 3 parts
% clip_lat = [];
clip_lat = [-27 27];
save_flag = false;

shapeoutC = make_coast_polygon(reso, bbox, bufwidth, tol, 'min_area', min_area, ... %[output:group:97137cd8] %[output:2bfb75bf]
                                                          'latq', latq, ... %[output:2bfb75bf]
                                                          'lonq', lonq, ... %[output:2bfb75bf]
                                                          'clip_lat', clip_lat, ... %[output:2bfb75bf]
                                                          'save_flag', save_flag); %[output:group:97137cd8] %[output:2bfb75bf]
%%
%[text] ## 1.2 Download ICESat-2 ATL03 data
% using python script `download_icesat2.py`
%%
%[text] ## 1.3 Analyze ICESat-2 ATL03 data
yList = 2018;
mList = 10;
save_flag = 1;

for year = yList %[output:group:09cb790d]
    for month = mList
        datestr = sprintf('%04d%02d**', year, month);
        S = analyze_icesat2_ocean(datestr, save_flag); %[output:327eeeae]
    end
end %[output:group:09cb790d]

%%
%[text] ## 1.4 Visualization
datestr = '201810';
save_flag = false;

plot_is2_granules(datestr, save_flag); %[output:41eda2bc]

